import React from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";

const Bug = (props) => {
  return <div></div>;
};

Bug.propTypes = {};

function mapStateToProps(state, { match }) {
  const { bugId } = match.params;

  return {
    bugId,
  };
}

export default connect(mapStateToProps)(Bug);
